import React, { useContext } from "react";
import "./topbar.css";


export default function Topbar() {

  return (
    <div className="topbar">
      <div className="topbarWrapper">
        <div className="topbarLeft">
          <a
            href="https://www.instagram.com/asvartika/"
            target="_blank"
            className="link"
            rel="noopener noreferrer"
          />
        </div>
      </div>   
    </div>
  );
}
